1) Летняя школа Майкрософт «Machine Learning and Intelligence», г. Санкт-
Петербург, 2015 г. – диплом II степени;
2)«Machine Learning One Week Hackathon», проводимый во время Летней школы Майкрософт «Машинное обучение и интеллект», 29 июля – 5 августа 2015г., диплом 2 степени;
3)Участник Молодежного Научно-Инновационного Конкурса («УМНИК»), г.
Красноярск, 2015 г. – победитель.

IT Школа Samsung (закончил); 
Победитель муниципального этапа Всероссийской олимпиады школьников; 
Диплом победителя по информатике и ИКТ на XII Городской олимпиаде; 
Сертификат участника в конкурсе-викторине по криптографии "Энигма" III Международного дистанционного морофона творческих конкурсов;
Диплом за победу во Всероссийском конкурсе видеороликов "Мобильные технологии для экологии".
